INSERT INTO `accueil_articles` VALUES (1,'Le nouveau BDE 2013','Voila le nouveau BDE 2013, tenu par la liste [gras]Gri[couleur=orange]ZZ[/couleur]lys[/gras] !\r\n\r\nVoici l\'équipe :\r\nPreZZ : Cyril Beyney\r\nVice-preZZ : Maxime Avillach\r\nTrésorière : Estelle Mounier\r\nTrésorier Adjoint : David Santiago\r\nSecrétaire : Marion Maugendre\r\nSecrétaire Adjoint : Valentin Allot\r\nRespo stock : Thibault Gloaguen / Edouard Mei\r\nRespo Com\' : Léo Derossis / Paul Gaucher / Marianne Lemoine\r\nRespo Event/Sponsors: Raphael Costa / Raphael Bevenot\r\n\r\nOn vous souhaite une excellente année en notre compagnie !','Voila le nouveau BDE 2013, tenu par la liste [gras]Gri[couleur=orange]ZZ[/couleur]lys[/gras] !\r\n\r\nVoici l\'équipe :\r\nPreZZ : Cyril Beyney\r\nVice-preZZ : Maxime Avillach\r\nTrésorière : Estelle Mounier\r\nTrésorier Adjoint : David Santiago\r\nSecrétaire : Marion Maugendre\r\nSecrétaire Adjoint : Valentin Allot\r\nRespo stock : Thibault Gloaguen / Edouard Mei\r\nRespo Com\' : Léo Derossis / Paul Gaucher / Marianne Lemoine\r\nRespo Event/Sponsors: Raphael Costa / Raphael Bevenot\r\n\r\nOn vous souhaite une excellente année en notre compagnie !','./images/articles_accueil/grizzlys.jpg'),(2,'Soirée No Limit Inter-BDE','MEGA soirée de lancement le jeudi 7 février 2013.\r\n\r\nUn battle entre [gras][souligne]ISIMA/AC2CG/EUM[/gras][/souligne]\r\n\r\nEvent Facebook : [lien=https://www.facebook.com/events/379735745455736/]ici[/lien]','MEGA soirée de lancement le jeudi 7 février 2013.\r\n\r\nUn battle entre [gras][souligne]ISIMA/AC2CG/EUM[/gras][/souligne]\r\n\r\n[souligne]AU PROGRAMME[/souligne] :\r\n\r\n- Gogo danseuses\r\n- Hôtesses\r\n- Service bar enflammé\r\n- Deux salles, deux ambiances\r\n- Nombreux goodies\r\n\r\n\r\n[souligne]TARIFS[/souligne] :\r\n\r\n- Entrée : 3€\r\n- Bouteilles : 60€ avant 1H (75€ après)\r\n- Consos : 6€\r\n- Pichet de bière : 10€\r\n\r\n\r\n[gras][couleur=red]Attention étudiants[/gras][/couleur], tenues non-correctes suggérées (La tenue la plus extravagante sera récompensée) !\r\n\r\nEvent Facebook : [lien=https://www.facebook.com/events/379735745455736/]ici[/lien]','./images/articles_accueil/no_limit.jpg'),(3,'ISIMA can do the Harlem Shake','Le BDE ISIMA n\'est pas passé à côté de l\'énorme buzz que fait cette vidéo et vous propose de participer à ce mouvement jeudi 28 Février l\'après midi. Le rendez-vous est fixé à 16h au BDE ISIMA.\r\n\r\nSi vous n\'avez jamais vu de voiture ou de piscine dans le BDE c\'est le moment.\r\n\r\nRamenez vos déguisements les plus farfelus (déguisements halloween, masques Anonymous ou Jabbawockeez, tête de cheval, perruques, à poil !), objets insolites (monocycle, bicycle, tricycle, tandem, skateboard, skis, sacs de couchage, matelas et poupées gonflables, peluches, animaux, iguane qui sert de la kro dans un syphon, nains...) et votre bonne humeur.\r\n\r\nSoyez le plus débile possible !\r\n\r\nEvent Facebook : [lien=https://www.facebook.com/events/131417700365843/]ici[/lien]','Le BDE ISIMA n\'est pas passé à côté de l\'énorme buzz que fait cette vidéo et vous propose de participer à ce mouvement jeudi 28 Février l\'après midi. Le rendez-vous est fixé à 16h au BDE ISIMA.\r\n\r\nSi vous n\'avez jamais vu de voiture ou de piscine dans le BDE c\'est le moment.\r\n\r\nRamenez vos déguisements les plus farfelus (déguisements halloween, masques Anonymous ou Jabbawockeez, tête de cheval, perruques, à poil !), objets insolites (monocycle, bicycle, tricycle, tandem, skateboard, skis, sacs de couchage, matelas et poupées gonflables, peluches, animaux, iguane qui sert de la kro dans un syphon, nains...) et votre bonne humeur.\r\n\r\nSoyez le plus débile possible !\r\n\r\nEvent Facebook : [lien=https://www.facebook.com/events/131417700365843/]ici[/lien]','./images/articles_accueil/harlem.jpg'),(4,'ISIMA can do the Harlem Shake : LA VIDEO','Voici la vidéo tant attendue :\r\n\r\n[lien=http://youtu.be/nuvfCDh4ljI/]ICI[/lien]\r\n','Voici la vidéo tant attendue :\r\n\r\n[lien=http://youtu.be/nuvfCDh4ljI/]ICI[/lien]','./images/articles_accueil/harlem2.jpg'),(5,'Soirée Saint Patrick','Le nouveau BDE ISIMA vous convie à fêter comme il se doit la Saint Patrick 2013, le vendredi 15 mars au BDE !\r\n\r\nEvent Facebook : [lien=https://www.facebook.com/events/485865534812511/]ici[/lien]','♣♣♣ SAINT PATRICK @ BDE ISIMA ♣♣♣\r\n\r\nEvent Facebook : [lien=https://www.facebook.com/events/485865534812511/]ici[/lien]\r\n\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\r\n\r\n✞ Je la lève aujourd\'hui\r\npar une force puissante,\r\nl\'invocation de la Guinness,\r\nla croyance en la Stout,\r\nla confession de l’ivresse\r\ndu Créateur du roux.\r\n\r\n[...]\r\n\r\nQue le Christ me protège aujourd\'hui\r\ncontre le poison, contre le feu,\r\ncontre la noyade, contre la blessure,\r\npour qu\'il me vienne une foule de récompenses,\r\nle Christ avec moi,\r\nle Christ devant moi,\r\nle Christ derrière moi,\r\nle Christ en moi,\r\nle Christ au-dessus de moi,\r\nle Christ au-dessous de moi,\r\nle Christ à ma droite,\r\nle Christ à ma gauche,\r\nle Christ en largeur,\r\nle Christ en longueur,\r\nle Christ en hauteur,\r\nle Christ en profondeur,\r\nle Christ dans le cœur\r\nde tout homme qui pense à moi,\r\nle Christ dans tout œil qui me voit,\r\nle Christ dans toute oreille qui m\'écoute.\r\n\r\nAMEN ✞\r\n\r\n[ Extrait de la Prière de Saint Patrick (revue et modernisée) ]\r\n\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\r\n\r\nLe nouveau BDE ISIMA vous convie à fêter comme il se doit la Saint Patrick 2013.\r\n\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\r\n\r\n► Préchauffe à 22h :\r\n\r\nConcert irlandais \"Dúbailte\"\r\n♀ HAPPY HOURS pour les filles de 22h à minuit ♀\r\n\r\n► Guinness à 2 €\r\n► Bière ambrée à 1,5 €\r\n\r\n► Sandwiches pour les couche-tard\r\n\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\r\n\r\nVenez déguisés dans le thème (kilt, chapeaux de la soirée Saint Patrick de Polytech...) !\r\nLes mieux déguisés seront récompensés avant 00h !\r\n\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\r\n\r\nLa soirée se situe au BDE ISIMA, sur le Campus des Cézeaux.\r\n\r\nArrêt tram : Campus\r\nAccès depuis Paris : A71 direction Clermont-Ferrand\r\nAccès depuis Marseille : A7 direction Lyon\r\nAccès depuis le bled : A préciser\r\n\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬','./images/articles_accueil/patrick.jpg'),(6,'Soirée Full Moon Party ','☾FULL MOON PARTY☽ @ SpringBreak by BDE ISIMA\r\nen partenariat avec NRJ Clermont\r\n\r\nEvent Facebook : [lien=https://www.facebook.com/events/486315841417319/]ici[/lien]','☾FULL MOON PARTY☽ @ SpringBreak by BDE ISIMA\r\nen partenariat avec NRJ Clermont\r\n\r\nLa pleine lune approche et le printemps est de retour.\r\n\r\nLes passions se déchaînent et la libido est à son plus haut niveau.\r\n\r\nLibérez-vous comme vous ne vous êtes jamais libérés, osez tout ce que vous n\'avez jamais osé, lâchez-vous au SpringBreak ce vendredi 22 mars.\r\n\r\n★ Programme ★\r\n\r\nBody Painting\r\nGogo Danseuses\r\nT-shirt Mouillé\r\nGoodies\r\nCanon à mousse\r\n2 salles / 2 ambiances\r\n2 HAPPY HOURS à 5€ la bouteille de rhum arrangé (50cl)\r\n\r\n★ Tarifs ★\r\n\r\nEntrée: 3€\r\nBouteilles de rhum arrangé (50cl): 10€\r\nEt plus encore ...\r\n\r\n★ Infos & Contacts ★\r\n\r\n18, rue des deux marchés\r\n63000 Clermont-Ferrand','./images/articles_accueil/full.jpg'),(7,'Soirée Romaine','SOIREE ROMAINE @ BDE ISIMA le vendredi 12 avril\r\n\r\nEvent Facebook : [lien=https://www.facebook.com/events/188498154630960/]ici[/lien]','SOIREE ROMAINE @ BDE ISIMA le vendredi 12 avirl\r\n\r\nEvent Facebook : [lien=https://www.facebook.com/events/188498154630960/]ici[/lien]\r\n\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\r\n\r\nVENI BIBI NON MEMINI (je suis venu, j\'ai bu, je ne me souviens plus) sont les mots (presque) célèbres par lesquels Jules César annonça la rapidité de sa victoire aux cotés du BDE ISIMA qu\'il venait de remporter dans les vignes d\'Aubière.\r\n\r\nPour célébrer cela, comme le veut la tradition romaine, chaque année le BDE se doit d\'honorer ce dicton et faire couler le vin à flot en l\'honneur de leurs ancêtres ayant vaillamment combattu.\r\n\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\r\n\r\n► Start 23h\r\n\r\n► Sangria à 1 €\r\n► Bière blonde à 1 €\r\n► Bière rousse à 1,5 €\r\n\r\n► Sandwiches pour les Gaulois affamés\r\n\r\n► Special Guest : Bacchus (dieu du vin, de l\'ivresse, des débordements, notamment sexuels, ainsi que de la nature.)\r\n\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\r\n\r\nLa soirée se situe au BDE ISIMA, sur le Campus des Cézeaux).\r\n\r\nArrêt tram : Campus\r\nAccès depuis Paris : A71 direction Clermont-Ferrand\r\nAccès depuis Marseille : A7 direction Lyon\r\nAccès depuis le bled : A préciser\r\n\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬','./images/articles_accueil/soireeromaine.jpg'),(10,'Nouveau site BDE','Le BDE 2013 vous présente son nouveau site !','','./images/articles_accueil/905445_469526379793423_342081076_o.jpg'),(11,'Concert rock avec Vulcan Event','En partenariat avec [gras]Vulcan Event[/gras], le [gras]BDE ISIMA[/gras] vous annonce un concert rock crescendo tout en puissance à partir de [couleur=red]20h30[/couleur].\r\n\r\nOn débutera cette soirée par un barbecue à partir de 20h.\r\n\r\nDe la bière et le cerf allemand seront de la partie.\r\n\r\nEvent Facebook : [lien=https://www.facebook.com/events/154424304723206/]ici[/lien]','En partenariat avec nous, c\'est le premier événement de l\'association Vulcan Event !\r\n\r\n Un concert crescendo toute en puissance avec :\r\n\r\n[list][li]Doudou Vampire (Rock Français) : Groupe naissant avec déjà tout un univers autours de ses 3 membres ! Du son et du sang pour nos Vampires parisiens qui ouvrent le bal avec énergie ![/li]\r\n[li]RedLights (Hard Rock) : C\'est un voyage dans le temps avec comme seule limite la folie Rock\'N\'Rollesque des années 70, 80 qui se mêle au son des guitares actuelles! Faites chauffer les Harley ![/li]\r\n[li]Big Rush (Stoner Metal) : De la voix, des harmonies et des riffs lourds ! C\'est ce que Big Rush vous présentera pour terminer le concert ! Du bon Stoner à la sauce Metal c\'est tout ce qu\'il fallait pour achever nos oreilles innocentes ![/li][/list]\r\nL\'entrée est [souligne]gratuite[/souligne] !\r\n\r\nOn commencera par un barbecue à partir de 20h, puis on enchaînera sur le concert à partir de 20h30 !\r\n\r\nNous vous présenterons l\'association Vulcan Event lors de ce concert mais c\'est aussi l\'occasion de se retrouver autours de la tireuse à bière pour passer une excellente soirée dans nos locaux !\r\n\r\nPour l\'événement Facebook, c\'est [lien=https://www.facebook.com/events/154424304723206/]ici[/lien] !','./images/articles_accueil/soiree18mai.jpg'),(17,'Concert MuZZic','Le club de musique de l\'ISIMA vous présente son concert @ BDE ISIMA le 22/05\r\n\r\nEvent Facebook : [lien=https://www.facebook.com/events/385449514900936/]ici[/lien]','	Le club de musique de l\'ISIMA organise une soirée concert avec:\r\n\r\n- Edenmess: Groupe de Rock\'n\'metal qui nous vient tout droit de Nevers pour en mettre plein les oreilles!\r\nhttps://www.facebook.com/EdenmessBand?fref=ts\r\n\r\n-Three guys: Groupe de Rock de l\'IFMA qui a déjà animé à plusieurs reprises les évènements ZZ!\r\n\r\n-Les JazzyGeek: inutile de les présenter, ils mettent le feu aux soirées concerts de l\'ISIMA depuis un certain temps avec leur musique festive!\r\nhttps://www.facebook.com/pages/JaZZyGeeks/197155330328461?fref=ts\r\n\r\n-The Shipwreck: Groupe de Hard Rock constitué d\'anciens ZZ, reformé récemment pour notre plus grand plaisir!\r\n\r\n-Un nouveau groupe de Rock qui n\'a pas encore de nom et qui va faire ses grands débuts sur la scène Isimalienne.\r\n\r\nEt pour nous désaltérer nous pourrons compter sur la présence d\'ISIMALT et de ses multiples bières.','./images/articles_accueil/308518_10201245065872485_1995854735_n.jpg'),(22,'Soirée AdopteUnIngénieur','Les BDEs ISIMA, IFMA et POLYTECH vous attendent nombreux @ MIDDLENIGHT le 24/05 !\r\n\r\nPréchauffe au BDE ISIMA de 20h à minuit avec conso offerte avec la prévente !\r\n\r\nEvent Facebook : [lien=https://www.facebook.com/events/374196489358417/]ici[/lien]','Dear futurs ingénieux Clermontois et Clermontoises ,\r\nOn sait, c\'est le retour des vacances, les exams approchent, il fait moche et c\'est la loose. Mais ne vous inquiétez pas, les BDE de l\'IFMA, de l\'ISIMA et de POLYTECH ont tout prévu !\r\nMesdames et Messieurs votre attention s\'il vous plait... ne manquez pour rien au monde la soirée 3 écoles \"ADOPTE UN INGÉNIEUR\" ! Tout ce que vous devez savoir, c\'est qu\'elle se déroulera le VENDREDI 24 MAI au MIDDLE NIGHT à partir de 23H et que ça va être LEGEN... wait for it... DARY !\r\n\r\n► Le thème\r\n\r\nTu rêves qu\'un superbe mécanicien répare ta voiture torse nu ? Qu\'une biologiste joue au docteur avec toi ? Ou encore qu\'on t\'expose de belles grosses poutres ?\r\nAlors, que tu sois un mécanicien, informaticien, biologiste, physicien, électricien, mathématicien ou même dans le génie civil (qui ne peuvent pas avoir un nom comme tout le monde), vient représenter fièrement tes couleurs et sélectionne parmi nos meilleurs produits, l\'ingénieur de tes rêves.\r\n\r\n\r\n► La soirée\r\n\r\nRendez-vous dès 23h au MIDDLE NIGHT (12 Rue Ramond)\r\n\r\nEntrée → préventes à 3€ disponibles dans vos BDE\r\n\r\n\r\n► Arrêt de tram : Lagarlaye\r\n\r\nPS 1 : [lien=https://www.facebook.com/pages/Le-Middle-Night/151291424958804?fref=ts/]Facebook MiddleNight[/lien]\r\nPS 2 : Pour tous nos produits, vous êtes satisfaits ou remboursés\r\nPS 3 : \"Ingénieurs-objets à câliner\"\r\nPS 4 : Girls run the night → bienvenue aux soldes !\r\nPS 5 : fin des PS.\r\n\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬','./images/articles_accueil/adopteuninge.jpg'),(23,'Hawaii Party @ BDE ISIMA','En ce fin de mois de Mai, il est temps de faire une soirée [italique]caliente[/italique].\r\n\r\nHAWAII PARTY c\'est au BDE ISIMA, le vendredi 31 Mai.\r\n\r\nAvec la présence d\'américains bien en forme, cette soirée sera inoubliable !\r\n\r\nEvent Facebook : [lien=https://www.facebook.com/events/198134207003515/]ici[/lien]','☼ HAWAII PARTY @ BDE ISIMA ☼\r\n\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\r\n\r\nALOHA !\r\n\r\nLe soleil a du mal à se montrer et le manque de chaleur se fait sentir.\r\nOn a pensé à vous !\r\n\r\nHAWAII se ramène au BDE ISIMA.\r\n\r\nBarbecue, chaleur, palmiers, colliers à fleurs, filles sexy et plus si affinités seront à l\'honneur !\r\n\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\r\n\r\nVenez goûter nos bières et cocktails tropicaux :\r\n\r\n► Bière banane\r\n► Bière coco\r\n► Cocktails exotiques\r\n► et plus encore ...\r\n\r\n\r\n► Préchauffe à 20h avec barbecue exotique\r\n\r\n► Et à 23h, début d\'une soirée \"muy caliente\" !\r\n\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\r\n\r\nLa soirée se situe au BDE ISIMA, sur le Campus des Cézeaux.\r\n\r\nArrêt tram : Campus\r\nAccès depuis Paris : A71 direction Clermont-Ferrand\r\nAccès depuis Marseille : A7 direction Lyon\r\nAccès depuis le bled : A préciser\r\n\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\r\n\r\nEvent Facebook : [lien=https://www.facebook.com/events/198134207003515/]ici[/lien]','./images/articles_accueil/affiche.jpg'),(24,'Soirée Féria @ BDE ISIMA','SOIREE FERIA @ BDE ISIMA le vendredi 21 Juin\r\nEvent Facebook : [lien=https://www.facebook.com/events/205410879608546/]ici[/lien]','Pour cette soirée de fin d\'année, le BDE ISIMA vous proposer une soirée Féria pour finir l\'année en beauté !\r\n\r\nAu programme :\r\n- Barbecue proposé par ISIBOUFFE\r\n- Piscine olympique avec un plongeoir depuis le toit de l\'ISIMA (Objectif : 10m).\r\n- VENTRIGLISSE sur le globe de l\'IFMA.\r\n\r\nComme vous le savez peut-être, il s\'agira d\'une soirée fin de partiel pour les ZZ1, ce sera donc l\'occasion de poser les cerveaux (un vestiaire sera d\'ailleurs prévu à cet effet), afin de ne pas transpirer l\'intelligence.\r\n\r\nLa \"soirée\" commencera à 16h avec un concours de jaune-pétanque.\r\n\r\nIl y aura beaucoup de jaune, d\'ailleurs il devrait pleuvoir du jaune aux alentours de 11h51, et surement de la sangria :D\r\n\r\nLe dress-code de la soirée est rouge et blanc, nous distribuerons beaucoup de goodies durant la soirée grâce à notre sponsor (une grande marque vendant une boisson jaune à base d\'anis originaire de Marseille commençant par Ri (comme Rire) et finissant par Card (comme Cardiologue)).\r\nSi vous ne savez pas de qui il s\'agit, une petite charade pour vous :\r\n- Mon premier se mange en Chine\r\n- Mon second m\'amène tous les jours à l\'école\r\n=> Mon tout se boit à l\'apéro entre 2 bowls de pétanques.\r\n\r\nVous l\'aurez compris, nous vous attendons le 21 Juin afin d\'enterrer comme il se doit cette année de débauche et de réussite (nous l\'espérons) que nous avons passé tous ensemble.','./images/articles_accueil/994273_490083501071044_65038500_n.jpg'),(26,'Soirée \"Mousse Ton Fillot\" @ BDE ISIMA','Le BDE ISIMA organise sa toute première grosse soirée de la rentrée.\r\n\r\nDans la continuité de l\'intégration 2013, dans un BDE immergé de mousse, il faudra montrer à ses fillots tous fraîchement arrivés, comment on fait la fête à l\'ISIMA.\r\n\r\nEvent Facebook : [lien=https://www.facebook.com/events/599814633397385]ici[/lien]','☼ Soirée \"MOUSSE TON FILLOT\" @ BDE ISIMA ☼\r\n\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\r\n\r\nLa première grosse soirée organisée par le BDE ISIMA de la rentrée et sûrement LA soirée de l\'année.\r\n\r\nPour cette soirée unique, le BDE a mis des moyens astronomiques avec une machine à mousse qui inondera le dancefloor.\r\n\r\nC\'est l\'occasion de montrer à son tout nouveau fillot comment faire la fête à l\'ISIMA (parce que ce sont les meilleures soirées) et de le faire mousser !\r\n\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\r\n\r\nL\'entrée est, comme toujours, absolument GRATUITE et les tarifs consos restent toujours aussi économiques.\r\n\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\r\n\r\nStart à 23h jusqu\'à l\'aube !\r\n\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\r\n\r\nIl est conseillé une tenue très incorrecte et folle.\r\n\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\r\n\r\nLa soirée se situe au BDE ISIMA, sur le Campus des Cézeaux.\r\n\r\nArrêt tram : Campus\r\nAccès depuis Paris : A71 direction Clermont-Ferrand\r\nAccès depuis Marseille : A7 direction Lyon\r\nAccès depuis le bled : A préciser\r\n\r\n▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬▬\r\n\r\nEvent Facebook : [lien=https://www.facebook.com/events/599814633397385]ici[/lien]','./images/articles_accueil/mousse.jpg'),(27,'Soirée \"Don\'t Be Sorry If You\'re Crazy\" @ BBOX CLUB','La plus grosse soirée en boîte de l\'année revient !\r\n\r\n5 écoles dans LA plus grande boîte mono-salle de France !\r\n\r\n[gras]DON\'T BE SORRY IF YOU\'RE CRAZY[/gras] le jeudi 10 octobre au BBOX CLUB.\r\n\r\nLes préventes sont disponibles au BDE : 5€ la prévente et de nombreux goodies tirés au sort pendant la soirée !\r\n\r\nOn vous attend !\r\n\r\nEvent Facebook : [lien=https://www.facebook.com/events/620659107977462/]ici[/lien]','Vous l\'attendiez, elle est là ! Le point culminant de votre inté : La Soirée 5 Ecoles !\r\n\r\nENSCCF, IFMA, ISIMA, Polytech et VetAgro Sup et tous les autres, le BREI vous donne rendez vous le Jeudi 10 octobre :\r\n- Préchauffe au 3 Monkeys à partir de 21h\r\n- Soirée au BBox Club à partir de minuit !\r\n\r\nNavettes à Lecoq, CHU et Cézeaux\r\n\r\nPréventes 5€ aux BDE des 5 écoles et au 3 Monkeys\r\nSur Place 7€\r\n\r\nDress Code : Soyez juste fous et faîtes nous rêver !!!\r\n\r\nGoodies et Cadeaux prévus !','./images/articles_accueil/1243796_638486472852867_280275281_o.jpg'),(29,'Vêtements de promo','Vous l\'attendiez, la voici :\r\n\r\nLa nouvelle collection 2013/2014 est là !\r\n\r\nPour plus d\'infos et pour les commander, adressez-vous à un membre du BDE ou contactez-nous par mail au bde@poste.isima.fr !','Vous l\'attendiez, la voici :\r\n\r\nLa nouvelle collection 2013/2014 est là !\r\n\r\nPour plus d\'infos et pour les commander, adressez-vous à un membre du BDE ou contactez-nous par mail au bde@poste.isima.fr !','./images/articles_accueil/affichepolossite.jpg'),(30,'WED TURIN 2015','FUEGO\r\n\r\nA proposito de tradizzione, del matrimonio quene pensate ?\r\nChi va sano va piano y chi va sano va lontano !\r\nLingotto !!!!\r\nPorta Nueva !!!\r\nArivederci !!!','','https://fbcdn-sphotos-h-a.akamaihd.net/hphotos-ak-xpf1/v/t1.0-9/10172687_10206998570381800_4814030221133015041_n.jpg?oh=a470010e9ad7d620413f70f00fc22e68&oe=557000EF&__gda__=1438543760_9de6339b9a224ba45ca3a7653b64626b'),(32,'Beer Pong 04/03/16','','','./images/articles_accueil/12787532_10205353755874107_1593735466_o.jpg'),(33,'Saint Patrick 17/03/16','Saint Patrick au bar Le Carnot le 17 mars ','','./images/articles_accueil/st pat.jpg'),(34,'Soirée Spring break 18/03/16','De 22h à 4h, soirée Spring Break au BDE ISIMA','','./images/articles_accueil/12778883_1053093204747843_4399763464664766826_o.jpg'),(35,'Soirée Romaine 26/05/16','De 22h à 4h. Toge correcte exigée !','','./images/articles_accueil/13122996_1102655689791594_3826476912458590226_o.jpg'),(36,'Soirée Parrain/Fillot','Salut toi, le BDE ISIMA te convie a la meilleure soirée de l\\\'année : La soirée parrain-fillot! Viens découvrir les parrains et leur nouveaux filllots ! Viens t\\\'ambiancer dans l\\\'un des meilleurs BDE du campus !','#BREF si tu n\\\'as toujours pas compris, tout ce que tu dois savoir, c\\\'est que le BDE ISIMA est de retour et t\\\'invite toi, oui toi, à une soirée toujours plus WTF !!! Viens avec tes plus \\\"beaux\\\" habits et tout tes amis, car tu vas en voir de toutes les couleurs... Enfin je dis ça, je dis rien... ;) Tu finiras dans un tel état que si ta mère te voyait ...\\r\\n\\r\\nBien entendu, cette soirée ne se fera pas sans alcool. Tu peux donc acheter des cartes conso 10€ afin d\\\'étancher ta soif entre deux chorés avec les différentes boissons que nous te proposerons. Il y aura également une HAPPY HOUR de 22h à minuit.\\r\\n\\r\\nNous t\\\'attendons donc pour la plus grande et la plus folle de nos soirées !!! Je peux te garantir que ça va être le feu !! Même ta mère n\\\'en croira pas ses yeux !!','./images/articles_accueil/14393905_10210769552380782_861015306_o.jpg'),(37,'Soirée SUPERNOVA','Chers camarades, nous avons besoin de vous pour une mission de la plus haute importance.','Chers camarades, nous avons besoin de vous pour une mission de la plus haute importance.\r\nNos confrères ZZ2 et ZZ3 partent en voyage interstellaire afin de rejoindre une planète bien différente de la nôtre, la planète des entreprises.\r\nIls sont peu nombreux pour ce long et dangereux périple spatial qui demande une solidarité infinie.\r\nNOUS DEVONS LES AIDER !!\r\nUne énorme soirée est organisée le soir du départ de la navette spatiale afin que nos soldats ZZ s’envolent dans une atmosphère d’ambiance et soient prêt mentalement pour ce voyage.\r\nNous comptons sur vous pour venir mettre le feu dans une ambiance galactique de folie !!','./images/articles_accueil/test supernova.png');
