INSERT INTO `calendrier` VALUES (1,0,10,10,2016,'2016-10-10 18:00:00','2016-10-10 21:30:00','Olympiades JOUR 1','Premier jour des olympiades, épreuves ReZZo !','2016-10-10 15:52:32',1),(2,1,13,10,2016,'2016-10-13 18:00:00','2016-10-13 21:30:00','Olympiades JOUR 3','Epreuve BDS !','2016-10-13 10:12:50',1),(3,27,17,10,2016,'0000-00-00 00:00:00','0000-00-00 00:00:00','Olympiades JOUR 4','Epreuve BDA !','2016-10-14 19:02:00',1),(4,10,19,10,2016,'0000-00-00 00:00:00','0000-00-00 00:00:00','Olympiades JOUR 5','Épreuve AssoFinale ! Mystère mystere...','2016-10-14 19:03:01',1),(5,0,21,10,2016,'0000-00-00 00:00:00','0000-00-00 00:00:00','Olympiades LAST DAY','Épreuve finale du BDE : classique !','2016-10-14 19:03:51',1),(6,0,9,11,2016,'2016-09-11 18:00:00','2016-09-11 21:30:00','N\'oubliez pas les paroles','En duo, tentez de remporter vos places pour Chinese Man et Deluxe','2016-11-07 11:25:26',1),(7,0,10,11,2016,'2016-11-10 19:00:00','2016-11-10 21:00:00','Hockey sur glace','RDV a 20H à la patinoire pour assister aux matchs des Sangliers ! 7€, conso offerte (carte étudiante)','2016-11-07 11:27:19',1),(8,26,16,11,2016,'2016-11-16 11:00:00','2016-11-16 12:30:00','Récré d\'Anelis - IoT','Event FB : https://www.facebook.com/events/674554609380783/\r\n---------\r\nChers ZZs, les récrés d\'Anelis reviennent ! \r\n\r\nPour ceux qui ne connaissent pas le concept est simple : les anciens viennent parler d\'un sujet un mercredi entre 12 et 13h, puis un buffet vous permet d\'échanger avec eux de 13h à 13h30. \r\n\r\nPour cette édition, nous vous donnons rendez-vous le 16 novembre, avec comme thème l\'IoT (Internet of Things / Internet des Objets).\r\n\r\nNous aurons la présence de Paul Pinault (Promo 2000) et Daniel Petisme (Promo 2011) d\'Ingenious Things ainsi que de Laurent Gineste (Promo 2002) et Julien Coudon (Promo 2003) d\'Exotic Systems.\r\n\r\nVous apprendrez comment transformer votre chien en chien connecté, ou bien comment donner de l\'intelligence à votre frigo !\r\n\r\nLa présentation se déroulera en Amphi 1 du pôle commun et commencera vers midi. A la fin de la présentation, Anelis vous convie à son buffet froid dans le hall du pôle commun.\r\n\r\nVenez nombreux et partagez l\'événement à la communauté ZZ !','2016-11-14 17:49:12',1),(9,10,3,2,2017,'2017-02-03 21:00:00','2017-02-04 03:00:00','Soirée de passation AssoFinale au BDE','La soirée de passation du BDE : Orange is the New Black !','2017-01-17 22:12:11',1),(10,3,4,2,2017,'2017-02-04 19:00:00','2017-02-05 01:00:00','Gala ISIMA by Isigala','Le gala de l\'école !','2017-01-17 22:12:49',1),(11,0,27,2,2017,'2017-01-27 21:00:00','2017-01-28 03:00:00','Soirée Made the BDE Great Again','Fin de partiels des ZZ1, nous ne pouvions rater ça. On se retrouve à 22H pour fêter ça, comme à l\'époque !','2017-01-17 22:15:17',1),(12,10,28,2,2017,'2017-02-28 18:30:00','2017-02-28 22:59:59','Briefing WED','L\'AssoFi vous présente le week end de désintégration, venez nombreux pour en découvrir la destination !','2017-02-10 17:19:23',1),(13,27,16,2,2017,'2017-02-16 19:00:00','2017-02-16 22:59:59','Soirée de passation BDA ','Présentation de la nouvelle équipe BDA avec des activités.','2017-02-10 17:23:33',1),(14,0,10,3,2017,'2017-03-10 21:00:00','2017-03-11 03:00:00','Soirée SUPERNOVA','Chers camarades, nous avons besoin de vous pour une mission de la plus haute importance.\r\nNos confrères ZZ2 et ZZ3 partent en voyage interstellaire afin de rejoindre une planète bien différente de la nôtre, la planète des entreprises.\r\nIls sont peu nombreux pour ce long et dangereux périple spatial qui demande une solidarité infinie.\r\nNOUS DEVONS LES AIDER !!\r\nUne énorme soirée est organisée le soir du départ de la navette spatiale afin que nos soldats ZZ s’envolent dans une atmosphère d’ambiance et soient prêt mentalement pour ce voyage.\r\nNous comptons sur vous pour venir mettre le feu dans une ambiance galactique de folie !!','2017-03-06 20:41:02',1);
