INSERT INTO `clubs` VALUES (0,36,'./images/clubs/bde-logo.JPG','BDE','Le Bureau des Élèves de l\'ISIMA','Le [gras]BDE[/gras] (Bureau des élèves) comme tu l\'as sans doute compris est l\'association des meilleures associations !\r\n\r\nIl s\'occupe d\'organiser et d\'animer les soirées et festivités au foyer comme à l\'exterieur. Bien sûr la collaboration inter école va de soi, plusieurs soirées et activités par mois s\'organisent avec la participation de plusieurs BDE ce qui permet d\'avoir plus de joie et de bonne humeur au sein de la plus belle et meilleure ville du monde qu\'est Clermont-Ferrand.','2016-10-06 21:36:34',1,'','',''),(1,112,'./images/clubs/logo-bds-2017.jpg','BDS','Le Bureau des Sports de l\'ISIMA',' Salut à toi cher sportif !\r\n\r\nQuoi de mieux d\'autre que de se défouler entre ZZs après une journée de cours ? \r\n\r\nLe BDS est là pour te proposer plusieurs activités sportives et représenter les couleurs de l’ISIMA au sein de différents championnats.\r\n\r\nEn ce qui concerne les sports, tu pourras trouver :\r\n\r\n[list][li]Rugby[/li]\r\n[li]Football[/li]\r\n[li]Basket[/li]\r\n[li]Handball[/li]\r\n[li]Badminton[/li]\r\n[li]Volleyball[/li][/list]\r\n\r\nD’autres sports peuvent être pratiqués au sein de l’université. Pour cela il faut se renseigner au SUAPS ou venir nous en parler pour avoir plus d’informations.\r\n\r\nLe BDS est aussi là pour t’inviter à de gros événements sportifs tels que le week-end ski ou le beach de Polytech Montpellier. Des sorties sportives dans la région seront proposés tout au long de l’année tout comme des soirées dans notre BDE de l’ISIMA !\r\n\r\nQue tu sois débutant ou sportif professionnel, vient représenter haut et fort les couleurs de l’ISIMA dans les différents championnats. On vous attend nombreux !\r\n','2016-10-02 22:03:25',1,'https://www.facebook.com/bds.isima?fref=ts','',''),(2,140,'./images/clubs/croque-monsieurBD.jpg','ISIBOUFFE','ISIBOUFFE est le club gastronomique de l\'ISIMA.','ISIBOUFFE est [gras]le club gastronomique[/gras] de l\'ISIMA. A ce titre, le club s’assure qu’aucun ZZ ne meurt d’inanition et tente de faire découvrir les produits et saveurs locales.\r\n\r\nISIBOUFFE intervient très souvent dans la vie de l’école, voici ses principales activités :\r\n\r\n[list][li][b]Préparer des repas :[/b] les mardis et jeudis midi Isibouffe propose aux ZZs un menu sain et équilibré, à base de croques-monsieurs, burgers, fajitas ou encore hot-dogs. Ces repas sont réalisés par les membres d’ISIBOUFFE entre 12h et 13h30 et rassemblent entre 40 et 60 ZZs dans une ambiance chaleureuse et conviviale.[/li]\r\n[li][b]Faire le marché :[/b] les membres d\'ISIBOUFFE se rendent tous les dimanches matins au marché d’Aubière afin de s’y procurer Saucissons et Fromages. Les ZZs qui le souhaitent ont la possibilité de passer commande afin de bénéficier de prix avantageux et d’une livraison directement à l’ISIMA.[/li]\r\n[li][b]Participer aux soirées des autres clubs :[/b] en partenariat avec les autres clubs de l’ISIMA (BDE, WEI, LVDIC...), il arrive qu’ISIBOUFFE fasse à manger durant les soirées. Sandwich, crêpes, dégustation de fromage  et charcuteries peuvent ainsi être proposés, au grand bonheur des gourmands et des étudiants qui ne veulent (ou ne savent) pas cuisiner.[/li]\r\n[li][b]Représenter l’ISIMA :[/b] bien que le guide Michelin ne nous ait pas encore donné d’étoiles, ISIBOUFFE représente tout le savoir-faire culinaire de l’ISIMA. A ce titre vous pourrez retrouver l’équipe ISIBOUFFE lors des Journées Portes Ouvertes, d’ISIMATIC ou pour accueillir les étudiants étrangers...[/li]\r\n[/list]','2016-03-07 20:49:34',1,'','',''),(3,116,'./images/clubs/logo-isigala-2017.png','ISIGALA','Le GALA est la soirée de l\'année par excellence de l\'école.','ISIGALA est une association qui a pour but d’organiser chaque année le gala de l’ISIMA. Elle est composée d’un groupe d’élèves de deuxième année et de premières années en formation pour le gala suivant. \r\n\r\nLe gala de l’ISIMA est une soirée qui regroupe la grande famille de l’école : le corps enseignant, les personnels administratifs, les entreprises partenaires de l’école, les anciennes générations ZZ et bien évidemment l’ensemble des étudiants actuels.\r\n\r\nCette soirée est LA soirée de l’année pour tout Isimalien qui se respecte. Sa mise en place nécessite de la part de ses organisateurs une grande motivation, un grand sens du « système D » ainsi que de gros bras musclés. Transport, salle, assurance, boissons, musique, traiteur, … sont autant de choses que les membres de l’association doivent maîtriser à la perfection pour rendre cette soirée mémorable aux quelques 300 invités présents.\r\n\r\nLe Gala est couplé avec un autre événement la même journée : le séminaire d’ANELIS. L’après-midi, d’anciens ZZ viennent présenter leurs métiers et échanger autour de tables rondes avec les élèves actuels. C’est un moment très apprécié en prélude à la soirée. Celle-ci commence à 19h avec des petits fours enchaînés par un délicieux repas ponctué de discours et d’animations. Enfin les groupes de muZZic donnent un concert suivi d’une soirée DJ.\r\n\r\nRetrouvez nous sur : http://www.gala.isima.fr/','2016-10-05 12:22:01',1,'https://www.facebook.com/isigala.isima?fref=ts','',''),(4,119,'./images/clubs/Muzzic.jpg','MUZZIC','MUZZIC est le club de musique de l\'école. Disposant de son propre matériel et de sa propre salle de répétition, il est un lieu où l\'on s\'y retrouve convivialement, pour se taper des bœuf.','Salut à toi ZZ musicien!\r\n\r\nTu cherches un endroit pour faire de la musique? Tes voisins te cassent les pieds à chaque fois que tu montes le volume de ton ampli ou que tu te défoules sur ta batterie? Le club MUZZIC a la solution a ton problème!\r\n\r\nUne salle avec tout le matos nécessaire est mise à ta disposition (à partir de 19h en semaine et toute la journée le week-end) pour pouvoir perfectionner ton répertoire sans craindre de rendre la petite vieille du dessus totalement dingue.\r\nAlors que tu sois un dingue de la double pédale, un roi du tapping(1) ou un novice dans le domaine du pizzicato(2) n\'hésites pas à venir répéter pour pouvoir venir jouer seul ou avec ton groupe de chevelus devant une foule en délire au BDE ou encore aux grands événements de la vie de l’école tels que le Gala ou la Remise des diplômes.\r\n\r\n[b]Matériel disponible :[/b]\r\nPour les chanteurs :\r\n[list][li]Plusieurs micros pour nous faire entendre ta douce voix[/li]\r\n[li]Des pieds pour faire tenir le micro (ça peut servir)[/li][/list]\r\nPour les batteurs :\r\n[list][li]Un set de base[/li]\r\n[li]Des pieds pour pouvoir y ajouter ta crash ou ta ride préférée[/li][/list]\r\nPour les bassistes :\r\n[list][li]Un ampli[/li][/list]\r\nPour les guitaristes\r\n[list][li]3 amplis différents[/li][/list]\r\nPour les pianistes : \r\n[list][li]Un synthétiseur[/li][/list]\r\n\r\n\r\n\r\nEt bien sûr assez de Jack/cables en tous genres pour pouvoir relier Clermont et Saint-Etienne.\r\n','2013-10-05 14:32:28',1,'','',''),(7,52,'./images/clubs/isimalt-logo.jpg','ISIMALT','ISIMALT est le club de dégustation de bière de l\'ISIMA','ISIMALT est le club de dégustation de bière de l\'ISIMA.\r\n\r\nNous sommes présents aux soirées organisées par le LVDIC ou pour les concerts de MUZZIC.\r\n\r\nNous vous proposons une large variété de bière allant de la très classique Delirium Tremens à la beaucoup moins classique Gulden Draak.\r\n\r\nBien entendu, nous organisons aussi des soirées en solo pour vous faire découvrir des toutes nouvelles bières. ','2016-01-27 18:34:37',1,'','',''),(8,180,'./images/clubs/image-logo.jpg','IMAGE','IMAGE est la micro entreprise de l\'ISIMA.','[b]Qu’est-ce qu’IMAGE ?[/b]\r\n\r\nImage, c’est une association loi 1901.\r\nSon but ? Assurer la formation complémentaire des étudiants de l’ISIMA (et arrondir leurs fins de mois !)\r\nComment ? Grâce à diverses études commandées par des entreprises et proposées aux étudiants.\r\n\r\nConcrètement, Image est une équipe d’étudiants de l’ISIMA renouvelée tous les ans et chargée de mettre en relation donneurs de projets (entreprises, administrations...) et étudiants capables de réaliser ces mêmes projets.\r\n\r\n[b]Comment ça se passe ?[/b]\r\n\r\nLes entreprises contactent Image pour la réalisation de leur projet. Nous nous chargeons ensuite d’établir un cahier des charges et proposons le projet aux étudiants. Image sélectionne ensuite l’étudiant dont le profil correspond le mieux aux attentes des clients.\r\n\r\nToute la partie administrative (devis, factures, salaire...) est alors gérée directement par les membres de l’association, ce qui permet aux étudiants de se concentrer pleinement sur la réalisation du produit tout en disposant d’un suivi d’un des membres qui est aussi là pour assurer la bonne communication entre l’entreprise et l’étudiant.\r\n\r\nAussi, si tu t’y connais en développement web, en programmation, en conception de bases de données, en maintenance de logiciels ou en d’autres domaines et que tu veux utiliser ton savoir-faire alors l’association IMAGE est là pour toi, étudiant de l’ISIMA ! N’hésite pas à surveiller tes mails et si un projet d’Image te tente, fais-le nous savoir ! \r\n\r\nNous avons déjà réalisé de nombreux projets pour EDF/GDF, Michelin, des cabinets d’avocats, des écoles et universités, des hôtels et bien d’autres. Alors n’hésite pas à te lancer et à répondre à nos offres !  ','2016-01-19 21:11:52',1,'','',''),(9,51,'./images/clubs/ReZZo.jpg','REZZO','Le club g33k de l\'ISIMA !','Chers passionnés d\'informatique,\r\nChers passionnés de jeux vidéos,\r\n\r\nVous aimeriez partager votre passion entre amis ?\r\nLe club ReZZo est fait pour vous !\r\nCe groupe provenant de l\'histoire même de l\'école vous proposera des soirées/journées\r\nanimées avec différents jeux en réseau pour s\'amuser et passer du bon temps ensemble.\r\nVous pourrez ainsi mettre à l\'épreuve vos talents de technicien, de précision,\r\nde réflexe et de rapidité face à vos aînés, seuls face à vos camarade ou en coopération.\r\nDe plus, si vous êtes nouveau dans certains jeux, ne vous en faites pas !\r\nIl y a de tous les niveaux de jeu parmi nos membres et vous trouverez tout de même à nos LAN\r\nde quoi passer un très bon moment avec d\'autres joueurs !\r\nTout ceci dans la joie et la bonne humeur, alors n\'hésitez plus ! ','2013-10-05 14:32:28',1,'','',''),(10,77,'./images/clubs/logo-asso.png','ASSOFINALE','L’AssoFinale est une association étudiante créée en 1998. Elle regroupe l’ensemble des  étudiants de troisième année de l’ISIMA.','[gras]Qui sommes-nous?[/gras]\r\n\r\nL’AssoFinale est une association étudiante créée en 1998. Elle regroupe l’ensemble des étudiants de troisième année de l’ISIMA qui souhaitent s’investir dans la vie étudiante pour leur dernière année au sein de l’école.\r\n \r\n\r\n[gras]Notre objectif[/gras]\r\n\r\nLa troisième et dernière année à l’ISIMA est pour ses élèves une transition importante  entre vie étudiante et vie professionnelle. L’AssoFinale se dédie à faire de celle-ci un moment fort, un souvenir qui restera gravé dans la mémoire des ingénieurs de demain.\r\n\r\nPour ce faire, le grand moment de transition entre vie étudiante et vie professionnelle reste la [italique]Cérémonie de Remise des Diplômes[/italique] qui a lieu fin septembre. L’autre évènement majeur organisé par l’AssoFinale est le [italique]Séminaire de Fin d’Etudes[/italique] qui a lieu fin mars.\r\n\r\n\r\n[gras]Nos activités[/gras]\r\n\r\nAfin de parvenir à organiser ces deux grands évènements, l’AssoFinale, tout au long de l’année organise plusieurs manifestations afin de réunir les fonds nécessaires à leur organisation et afin de rapprocher les étudiants s’il est encore besoin de le faire tout au long de la dernière année tous ensembles. Ainsi, au cours des années, différentes activités sont organisées telles que :\r\n\r\n[list][li]Des soirées étudiantes au [italique]Club BBox[/italique], plus grande boîte de nuit mono-salle de France.[/li]\r\n[li]Edition et vente du calendrier des Filles de l’ISIMA.[/li]\r\n[li]Organisation de tournoi de jeux de cartes (belote coinchée, tarot,..).[/li]\r\n[li]Organisation de soirées à thème (soirée Casino, soirée Concert, …).[/li][/list]','2013-10-05 14:32:28',1,'','',''),(11,33,'./images/clubs/isimix-logo.jpg','ISIMIX','ISIMIX est le club de mix de l\'ISIMA.','Salut les ZZ !\r\n\r\nEnvie de jouir des joies du mixage, de devenir l\'un des DJs officiels de l\'ISIMA ?\r\n\r\nISIMIX t\'accueille à bras ouverts. A chaque séance ISIMIX un pad Novation (Ableton) et une platine DDJ-WeGo de Pioneer est à la disposition de tous ceux qui souhaitent mixer toute la nuit.\r\n\r\nRamène ta musique et entraîne toi à devenir le DJ des soirées de l\'ISIMA pour faire bouger la foule sur ton mix. \r\n\r\nEnjoy =).','2016-01-27 18:34:52',1,'','',''),(12,146,'./images/clubs/isioke-logo.jpg','ISIOKE','ISIOKE c\'est d\'la balle !',' Tu n\'y croyais pas et pourtant c\'est vrai !\r\n\r\nL\'ISIMA possède sans doute l\'un des meilleurs clubs auquel vous pourrez participer pendant toute votre vie associative au sein de cette école.\r\n\r\nISIOKE ce n\'est pas n\'importe quoi, c\'est un véritable club formé avec une volonté de fer. La légende raconte que les deux ZZs ayant pris la merveilleuse résolution de former ce club avaient pour but de créer les meilleures soirées de l\'ISIMA, avec une ambiance à la fois déjantée et conviviale. La légende précise aussi que le nom si parfait de ce club serait issu du mélange incroyable de ISIMA et KARAOKE.\r\nSerait-ce donc pour cela que tous les événements organisés par ce club soient des soirées karaoké?\r\n\r\nLa création de ce club mythique remonte maintenant à fort longtemps, mais ses membres formeront à jamais une grande, belle et anonyme famille. Ayant subit un large essor ces dernières années, cette famille regroupe actuellement au moins plus d\'un millier d\'anonymes participant activement au déploiement de soirées de plus en plus festives.\r\n\r\nNotre galerie de musique s\'est fortement étendue au point d\'être multinationale, possédant des clips (sous-titrés par nos soins) français, anglais ou bien même asiatique. Ce club est de loin la référence de la qualité sonore à l\'ISIMA et nous tenons chaque année à entretenir cette image.\r\n\r\nAlors si toi aussi tu aimes chanter et danser, n\'hésite plus et rejoins notre grande famille. Nous t’accueillerons à bras ouverts et tu pourras à ton tour apporter ta pierre à l\'édifice !','2016-01-27 18:35:11',1,'','',''),(14,185,'./images/clubs/lvidc-logo-HD.jpg','LVDIC','Le club de jeux de l\'ISIMA','Le LVDIC, c\'est avant tout l\'un des clubs les plus anciens de l\'ISIMA, fondé en même \r\ntemps que l\'école, un club où la convivialité est de mise.\r\n\r\nAlors si tu veux t\'amuser avec tes potes, viens nous rejoindre !\r\nSi tu cherches à pourfendre des dragons avec une épée vorpale, ou bien simplement jouer \r\nà des jeux de société qui sortent un peu de l\'ordinaire, ce club est fait pour toi !\r\n\r\nEn effet, chaque mois, nous organisons une soirée LVDIC, au cours de laquelle tu pourras \r\nsiroter du cidre et défier tes amis à de nombreux jeux comme les Loups-Garous de \r\nThiercelieux, les Colons de Catane etc...\r\n\r\nEnvie de laisser parler ton imagination ? Nous organisons des parties de jeu de rôles \r\ntoute la semaine, avec des Maîtres du Jeu aussi amicaux qu\'impitoyable. Au programme des \r\nunivers comme ceux de Donjons et Dragons et de l\'Appel de Cthulhu.\r\n\r\nCes noms ne t\'évoquent rien ? Tu n\'as jamais pratiqué le jeu de rôle et tu hésites à \r\nvenir ? N\'aie crainte, nous accueillons aussi bien les joueurs débutants que les \r\nprofessionnels du massacre de kobolds. Des soirées d\'initiations sont organisés à la \r\nrentrée, mais tu n\'es pas obligé de les attendre. Le numéro des membres du club sont \r\nplacardé sur sa porte, et sinon, tu peux toujours nous contacter via ce mail : lvdic@poste.isima.fr\r\n\r\nTu veux t\'amuser, mais aucun club ne te branche vraiment ? Viens quand même nous en \r\nfaire part, et peut être pourrons nous mettre nos locaux à ta disposition !','2016-01-27 18:35:47',1,'','',''),(15,137,'./images/clubs/isibot.png','ISIBOT','Le club de robotique de l\'école.','Salut à toi lecteur ! Nous sommes heureux de t\'accueillir sur notre page de présentation. Nous, nous sommes les membres d\'ISIBOT, le club de robotique de l\'ISIMA. L\'objectif de notre club est simple :  participer chaque année à la coupe de France de robotique.\r\n\r\nCet événement a lieu tous les ans à La Ferté-Bernard (72) et propose aux participants de concevoir un robot autonome, qui doit évoluer sur une table de jeu en réalisant différentes actions pour collecter le plus de points possible. Il doit aussi faire face à un robot conçu par une équipe adverse, qui tente lui aussi d\'obtenir des points. Pour participer à cette coupe, nous avons besoin de toi !\r\n\r\nC\'est en partenariat avec le club de robotique de l\'IFMA que nous construisons et programmons chaque année un nouveau robot adapté aux épreuves de la coupe. Pour cela, il nous faut concevoir un châssis (le corps du robot, usiné par l\'IFMA), des circuits électroniques (dessinés au club ou achetés, suivant leur complexité), et enfin programmer une intelligence artificielle. C\'est cette dernière partie qui te permettra de mettre en pratique ce que tu auras appris en C/C++ à l\'ISIMA et ainsi de laisser s\'exprimer de manière concrète l\'informaticien génial qui sommeille en toi. C\'est pour réveiller cet être époustouflant et plein de talent que nous t\'invitons à nous rejoindre au plus vite.\r\n\r\nSi tu manques d\'expérience en robotique, nos membres se feront une joie de t\'aider à progresser dans ce domaine. Alors que ce soit pour nous donner un coup de main pour débugger un bout de code ou pour nous soumettre une idée de projet amusant ou révolutionnaire, n\'hésite plus et viens nous voir.','2013-10-06 17:14:52',1,'','https://twitter.com/ISIBOT\\\\\\\\_zZ',''),(16,111,'./images/clubs/isicine-logo.jpg','ISICINE','Le club ciné de l\'ISIMA','ISICINE est le club qui organise les soirées cinéma.\r\n\r\nQue tu sois cinéphile ou non, le club est ouvert à tout le monde! \r\n\r\nNous passons des films tous les mardis sur vidéoprojecteur : des films \"grand public\", des classiques ou des films plus difficiles d’accès, tout y passe. \r\n\r\nViens t’asseoir sur les canapés, manger du pop-corn et passer ta soirée au BDE, entre amis, autour d\'un film :-)','2016-01-27 18:34:06',1,'','',''),(25,140,'images/clubs/android-google-logo.jpg','ISIMOBILE','Club de développement mobile','ISIMOBILE est un club dédié aux ZZs intéressés par le développement mobile, qu’ils soient confirmés ou débutants.\r\n\r\nL’objectif est de se réunir afin de s’entraider dans l’apprentissage et la maîtrise des technologies mobiles en permettant à chacun d’apprendre et de progresser à son rythme.\r\n\r\nLe principal projet du club est l’application Android ISIDROID ([lien=http://doiop.com/isidroid]http://doiop.com/isidroid[/lien]), destinée aux ZZs. Les personnes intéressées ont la possibilité, au sein du club, de faire évoluer l’application en y ajoutant de nouvelles fonctionnalités. Cette application permet ainsi d’apprendre à développer pour Android, tout en permettant à son travail d\'être utile (et utilisé !) pour la communauté ZZ !\r\n\r\nSi tu es intéressé par le développement mobile, sous Android ou autre, et quel que soit ton niveau, n’hésite pas à nous contacter : isimobile.isima@gmail.com','2015-11-29 19:52:10',1,'','','https://plus.google.com/communities/113759869518347198698'),(26,116,'images/clubs/anelis-logo.jpg','ANELIS','L\'asso des vieux ZZs','Anelis ? \r\n\r\n[italique]Qu’est-ce qu’Anelis ?[/italique] \r\n\r\nCe n’est pas une blonde pulpeuse qui hante les couloirs de l’Isima (désolé ;-)) ni une bande de vieux croutons râleurs à l’image de ceux du Muppets Show (quoi que ? ;-) ). \r\n\r\nAnelis est l’association des [gras]AN[/gras]ciens [gras]E[/gras]lèves de [gras]l[/gras]\'[gras]IS[/gras]ima. Le but d’Anelis est de construire un réseau pour l’École en tissant le lien entre les promos. \r\n\r\n\r\n[italique]Qu’est-ce que cela signifie ?[/italique] \r\n\r\nPrincipalement organiser des événements où ZZ+ et ZZ actuels se retrouvent.\r\n\r\nLes événements marquants qui rythment l’année de l’association sont :\r\n- Les [gras]Payes  Ta  Mousse[/gras] :  Se  retrouver  devant  une  Bière simultanément dans de multiples villes de par le monde ! Cela permet d’intégrer les ZZ2 & 3 dans leurs régions d’adoption lors de leurs stages.\r\n- Les  [gras]Récrés[/gras] : Conférences courtes et ludiques autour d’un thème attractif, organisées à l’Isima, entre 12h00 et 13h00, ponctuées par un buffet offert aux participants et préparé par Isibouffe.\r\n- Le [gras]Séminaire[/gras] : Evènement phare qui se déroule chaque année au moment du Gala de l’Isima qui permet de partager entre ZZ et ZZ+ sur « l’après Isima ».\r\n\r\n\r\nPour tout savoir d\'Anelis et ne rien rater de tous ces événements, 2 choses impératives :\r\n- Suivre anelis\\\\_isima sur Twitter\r\n- Passer sur www.anelis.org de temps en temps','2016-01-19 21:10:50',1,'https://www.facebook.com/AneliZZ','https://twitter.com/anelis\\_isima',''),(27,191,'images/clubs/logo-bda.png','BDA','Le bureau des arts !','Tu as l’âme d’un artiste, tu souhaites pratiquer et partager ta passion alors rejoins-nous. Le Bureau des Arts a pour but de dynamiser et proposer des activités autour de l’art et de la culture à l’ISIMA. Bien que réhabilités très récemment, nous sommes ouverts à toute proposition d’évènement ou de travaux en rapport avec nos préoccupations principales : former l’esprit et la créativité en dehors du cadre du cadre des cours.\r\n\r\nÀ méditer : “Science sans conscience n’est que ruine de l’âme.”, François Rabelais.\r\n','2016-10-05 19:45:10',1,'','',''),(28,205,'images/clubs/isilabs-logo.png','ISILABS','HackLab de l\'isima','IsiLabs a pour objectif de créer d’un espace collaboratif et communautaire d’échange technologique sur le campus clermontois.\r\nCollaboration, Expérimentation, Fabrication, Développement et Programmation, Formation et Échanges sont autant de mots qui définissent notre projet. La vocation de cet espace est de permettre aux étudiants d\'horizons différents de découvrir de nouveaux domaines et de pouvoir se lancer dans des projets plus ou moins prometteurs, plus ou moins réalistes en associant les compétences de chacun. De toute façon, il n\'y a aucune obligation de résultat.\r\n\r\nVous pouvez nous retrouver tous les mercredis à partir de 17h30 en salle DS014 avec au programme une présentation sur une technologie, un petit point d\'actu et une discussion autour des projets de chacun.\r\n\r\nIl y a régulièrement des ateliers, d\'une durée de 2h environ, pour s\'initier à des nouvelles technologies (programmation embarquée, design, sécurité, ...)\r\n\r\nMais la salle peut également être ouverte en dehors de ces temps afin que chacun puisse travailler sur ses projets et utiliser les ressources à disposition. Le statut est présent sur notre site internet.\r\n\r\nRejoignez nous !\r\n\r\nQue vous soyez Prep\'ISIMA, ZZ1, 2, 3 ou plus, passionné ou tout simplement curieux, si vous êtes intéressé par la fabrication personnelle, le développement logiciel, la réalisation et la mise au point de prototypes, les logiciels libres, l’open hardware, le DIY, la bidouille (Hacking), nous avons besoin de vous pour nous aider à faire vivre et prospérer cette nouvelle communauté ouverte. Aucune compétence n\'est exigée,même juste des idées sont les bienvenues.\r\n\r\nRetrouvez nous sur : http://www.isilabs.fr','2016-01-19 21:11:23',1,'http://www.facebook.com/isilabs','https://twitter.com/isilabs','');
