INSERT INTO `partenaires` VALUES (1,'Crédit Agricole','\r\nLe Crédit Agricole est le principal partenaire du BDE.\r\nIl sponsorise l\'ensemble de nos événements et ceux du BDS.','images/partenaires/creditagricole.jpg'),(7,'Empire du Malt','\r\nEn terre Auvergnate, l\'Empire du Malt est un partenaire de choix : il nous propose ses produits, mais au delà de ça, il nous aide à l\'organisation de l\'ensemble de nos événements.','./images/partenaires/empiredumalt.jpg'),(14,'Radio Scoop','Radio Scoop Clermont-Ferrand diffuse de la musique (variétés, musique électronique, etc.) mais elle propose également des émissions interactives et des informations. Nouveau partenaire du BDE, cette radio nous permet d\'annoncer nos événements  sur leurs ondes !','images/partenaires/logo-radio-scoop.png'),(15,'STUD\'CITY','STUD’CITY, spécialiste du logement étudiant sur Clermont-Ferrand vous propose des logements meublés et équipés tout confort au plus proche des universités (à 7 min à pieds du campus des Cézeaux) tout en apportant les services pratiques de la vie quotidienne (laverie-sécherie,  salle de sport, salon détente, kit linge, wifi, parking) et vous assurant la tranquillité et la sécurité (digicode, gardien sur place et vidéo-surveillance).\r\n\r\nGrâce au partenariat établi avec le BDE, les étudiants de l\'ISIMA ont les frais de dossiers OFFERTS (d\'une valeur de 150€) !\r\n\r\nVisite immédiate sur place à la résidence :\r\nJEAN COCTEAU,\r\n9, Boulevard Pochet Layage,\r\n63000 Clermont-Ferrand.\r\n\r\nInformations et réservations au 04 73 28 43 08 ou sur leur site : www.studcity-clermont.com\r\n','images/partenaires/studcity.jpg');
/*!40000 ALTER TABLE `partenaires` ENABLE KEYS */;
UNLOCK TABLES;

